// Funciones en JS

// function saludar ( nombre ) {
//     return `Hola, ${ nombre }`;
// }

const saludar = ( nombre ) => {
    return `Hola, ${ nombre }`;
}

const saludar2 = ( nombre ) => `Hola, ${ nombre }`;

console.log( saludar( 'Goku' ));
console.log( saludar2( 'Goku' ));
